import styled from "styled-components";

const Card = styled.button`
  width: 100%;
  height: 80px;
  font-size: 100%;
  background-color: #790e8b;
  color: white;
  border: none;
  cursor: pointer;
  &:hover {
    background-color: #007c91;
  }
`;
export default Card;
